"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; N: 252</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1937</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Perunkirja</span><br />\n<span style=\"font-family:'Courier New';\">Vuonna 1937, toukokuun 2 p\u00e4iv\u00e4n\u00e4 toimittivat allekirjoittaneet</span><br />\n<span style=\"font-family:'Courier New';\">Alheidi Olsoni ja Ingrid Olsoni uskottuina miehin\u00e4</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;t\u00e4m\u00e4n kirjoittajana perunkirjoituksen helmikuun</span><br />\n<span style=\"font-family:'Courier New';\">4 p:n\u00e4 vuonna 1937 kuolleen Hilda Maria Nordberg'in j\u00e4lkeen,</span><br />\n<span style=\"font-family:'Courier New';\">jolla kuollessaan oli asunto- ja kotipaikka Viipurin kaupungissa</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ja jolta, kuten oheenliitetty ote kirkonkirjasta</span><br />\n<span style=\"font-family:'Courier New';\">osoittaa, j\u00e4i oikeudenomistajia: leski - &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o.s.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ja lapsia Maria Elvira Viola synt 19 7/12 03,</span><br />\n<span style=\"font-family:'Courier New';\">Alice Sivia Elina synt 19 13/1 06, Paul Vilhelm Valdemar synt 19 30/8 08</span><br />\n<span style=\"font-family:'Courier New';\">Edith Maria Adele synt 19 15/8 10</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">Saapuvilla toimituksessa, joka pidettiin</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;olivat Maria Elvira, Alice Sivi\u00e4 ja </span><br />\n<span style=\"font-family:'Courier New';\">Edith Maria Nordberg</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">[...]</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">Perint\u00f6veroa koskevia ilmoituksia vastaanottaa ja niist\u00e4 pes\u00e4nhoitajana vastaa</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Maria Elvira Nordberg</span><br />\n<span style=\"font-family:'Courier New';\">jonka osoite on: Viipuri, Lallukank. 4 as 1b</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Paikka ja aika kuin yll\u00e4:</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp;&lt;Maria Nordberg&gt; &nbsp;&lt;Alice Nordberg&gt; &nbsp;&lt;Edith Nordberg&gt;</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp;N\u00e4in toimitetuksi ja arvioiduksi vakuuttavat:</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">&lt;Alheidi Olsoni&gt; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&lt;Ingrid Olsoni&gt;</span><br />\n<span style=\"font-family:'Courier New';\">lastentarhanopettaja &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Neiti</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">[...]</span>\n</p>\n</div>\n</div>",
